import { createGlobalStyle } from 'styled-components'

export const GlobalStyle = createGlobalStyle`
  body {
    animation-name: blinker;
    animation-duration: 50s;
    animation-timing-function: linear;
    animation-iteration-count: infinite;
    @keyframes blinker {
      5% { background : url(${({ theme }) => theme.color_1}) no-repeat center center fixed}
      10% { background-color: ${({ theme }) => theme.color_2}}
      15% { background : url(${({ theme }) => theme.color_3}) no-repeat center center fixed}
      20% { background-color: ${({ theme }) => theme.color_4}}
      25% { background : url(${({ theme }) => theme.color_5}) no-repeat center center fixed}
      30% { background-color: ${({ theme }) => theme.color_6}}
      35% { background : url(${({ theme }) => theme.color_7}) no-repeat center center fixed}
      40% { background-color: ${({ theme }) => theme.color_8}}
      45% { background : url(${({ theme }) => theme.color_9}) no-repeat center center fixed}
      50% { background-color: ${({ theme }) => theme.color_10}}
      55% { background : url(${({ theme }) => theme.color_11}) no-repeat center center fixed}
      60% { background-color: ${({ theme }) => theme.color_12}}
      65% { background : url(${({ theme }) => theme.color_13}) no-repeat center center fixed}
      70% { background-color: ${({ theme }) => theme.color_14}}
      75% { background-color: ${({ theme }) => theme.color_15}}
      80% { background-color: ${({ theme }) => theme.color_16}}
      85% { background-color: ${({ theme }) => theme.color_17} }
      90% { background-color: ${({ theme }) => theme.color_18} }
      95% { background-color: ${({ theme }) => theme.color_19}}
      100% { background-color: ${({ theme }) => theme.color_20}}


    }
  }

`
